import { Box, Center, Flex, Grid, Stack, Text } from "@mantine/core";
import React from "react";

const Layout = () => {
  return (
    <Box bg="gray.4" h={200} style={{borderRadius: "10px"}}>
      <Stack>
        <Box bg="lime.3" style={{borderRadius: "10px 10px 0px 0px "}}>
          <Center>
            <Text>Test</Text>
          </Center>
        </Box>
        
      </Stack>
    </Box>
  );
};

export default Layout;
